import React, { Component } from "react";
import Navbar from "./navbar";
import Main from "./Main";
import Web3 from "web3";

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <Navbar />
        <Main />
      </React.Fragment>
    );
  }
}

export default App;
